demo.repl.help:
ਉਪਲਬਧ ਕਮਾਂਡਾਂ:
  @show              ─ ਆਖਰੀ adaptive card ਦਾ ਸਾਰ ਦਿਖਾਓ
  @json              ─ flow ਤੋਂ ਮਿਲੀ ਕੱਚੀ JSON value ਪ੍ਰਿੰਟ ਕਰੋ
  @back              ─ ਪਿਛਲੇ blocked card/inputs ਤੇ ਵਾਪਸ ਜਾਓ
  @input <k>=<v>     ─ ਇੱਕ input ਫੀਲਡ ਸੈੱਟ ਜਾਂ ਓਵਰਰਾਈਡ ਕਰੋ
  @click <action_id> ─ ਦਿੱਤੀ action ਨਾਲ card submit ਕਰੋ
  @help              ─ ਇਹ ਮਦਦ ਲਿਖਤ ਪ੍ਰਿੰਟ ਕਰੋ
  @quit              ─ REPL ਤੋਂ ਬਾਹਰ ਨਿਕਲੋ
